import React from "react";
import "../css/login.css";
import {Button, Col, Form, Input, Row} from "antd";
import {LeftOutlined, LockOutlined, UserOutlined} from "@ant-design/icons";
import {NavLink} from "react-router-dom";

class Findpwd extends React.Component {
    render() {
        return (
            <div className={"loginPage"}>
                <section className={"find-content"}>
                    <div style={{alignSelf: "flex-start", backgroundColor: "red",padding:"10px"}}>
                        <NavLink to={"/"} style={{color: "#91A0B5"}}><LeftOutlined/>返回</NavLink>
                    </div>
                    <h2>找回密码</h2>
                    <Form>
                        <Row>
                            <Col span={24}>
                                <Form.Item
                                    name={"username"}
                                    rules={[  // 规则
                                        {
                                            required: true,
                                            message: '用户名不能为空'
                                        }
                                    ]}
                                >
                                    <Input
                                        style={{borderRadius: "24px"}}
                                        prefix={<UserOutlined style={{color: 'rgba(0,0,0,0.25)'}}/>}
                                        placeholder={"请输入用户名"}
                                        size={"large"}/>
                                </Form.Item>
                            </Col>
                        </Row>
                        <Row>
                            <Col span={24}>
                                <Form.Item
                                    name={"username"}
                                    rules={[  // 规则
                                        {
                                            required: true,
                                            message: '用户名不能为空'
                                        }
                                    ]}
                                >
                                    <Input
                                        style={{borderRadius: "24px"}}
                                        prefix={<UserOutlined style={{color: 'rgba(0,0,0,0.25)'}}/>}
                                        placeholder={"请输入用户名"}
                                        size={"large"}/>
                                </Form.Item>
                            </Col>
                        </Row>
                        <Row>
                            <Col span={24}>
                                <Form.Item name="password"
                                           rules={[
                                               {
                                                   required: true,
                                                   message: '密码不能为空'
                                               }

                                           ]}>
                                    <Input.Password
                                        style={{borderRadius: "24px"}}
                                        prefix={<LockOutlined style={{color: "rgba(0,0,0,0.25)"}}/>}
                                        placeholder={"请输入密码"}
                                        size={"large"}/>
                                </Form.Item>
                            </Col>
                        </Row>
                        <Row>
                            <Col span={24}>
                                <Form.Item name="password"
                                           rules={[
                                               {
                                                   required: true,
                                                   message: '密码不能为空'
                                               }

                                           ]}>
                                    <Input.Password
                                        style={{borderRadius: "24px"}}
                                        prefix={<LockOutlined style={{color: "rgba(0,0,0,0.25)"}}/>}
                                        placeholder={"请输入密码"}
                                        size={"large"}/>
                                </Form.Item>
                            </Col>
                        </Row>
                        <Row>
                            <Col span={24}>
                                <Button type={"primary"} style={{width: "100%", borderRadius: "24px"}}
                                        size={"large"} onClick={this.login}>确定</Button>
                            </Col>
                        </Row>
                    </Form>
                </section>
            </div>
        )
    }
}

export default Findpwd;
